import React from 'react';
import Header from './components/Header';
import './App.css';
import Home from './components/Home';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import Detail from "./components/Detail";


function App() {
  return (
    <div className="App">
      <Router>
        <Header />
        <Switch>
          <Route path="detail">
            <Detail />
          </Route>
          <Route path="Home">
            <Home />
          </Route>
        </Switch>
      </Router>

      <Home />
    </div>
  );
}

export default App;
